import React from "react";
import Categoria from "../Categoria";
import "./style.css";

function Categorias() {
    const categoriasBar = ["Categoria 1", "Categoria 2", "Categoria 3", "Categoria 4", "Categoria 5", "Categoria 6"];

    return (
        <section className="general-data">
            {categoriasBar.map((elm, index) => 
                <Categoria
                    key={index} // Añadir key para evitar advertencias de React
                    categoria={elm} // Pasar elm como la categoría
                />
            )}
        </section>
    );
}

export default Categorias;
